// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract FRADocumentVerification {
    struct Document {
        string ipfsHash;
        string documentType;
        address uploader;
        uint256 timestamp;
        bool isVerified;
        bool exists;
    }
    
    mapping(bytes32 => Document) public documents;
    mapping(address => bool) public authorizedUploaders;
    address public admin;
    
    event DocumentStored(bytes32 indexed docHash, string ipfsHash, address uploader);
    event DocumentVerified(bytes32 indexed docHash, bool isVerified);
    event UploaderAuthorized(address indexed uploader);
    
    constructor() {
        admin = msg.sender;
        authorizedUploaders[admin] = true;
    }
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }
    
    modifier onlyAuthorized() {
        require(authorizedUploaders[msg.sender], "Not authorized to upload documents");
        _;
    }
    
    function storeDocument(
        bytes32 docHash, 
        string memory ipfsHash, 
        string memory docType
    ) public onlyAuthorized {
        require(!documents[docHash].exists, "Document already exists");
        
        documents[docHash] = Document({
            ipfsHash: ipfsHash,
            documentType: docType,
            uploader: msg.sender,
            timestamp: block.timestamp,
            isVerified: true,
            exists: true
        });
        
        emit DocumentStored(docHash, ipfsHash, msg.sender);
    }
    
    function verifyDocument(bytes32 docHash) public view returns (bool) {
        return documents[docHash].exists && documents[docHash].isVerified;
    }
    
    function getDocumentDetails(bytes32 docHash) public view returns (Document memory) {
        require(documents[docHash].exists, "Document does not exist");
        return documents[docHash];
    }
    
    function authorizeUploader(address uploader) public onlyAdmin {
        authorizedUploaders[uploader] = true;
        emit UploaderAuthorized(uploader);
    }
    
    function revokeUploader(address uploader) public onlyAdmin {
        authorizedUploaders[uploader] = false;
    }
}
